package com.greatlearning.asendingdecending;

public class DefiningVeriables {
	
	String s;
	int n; 
	int k=0;
	int z=0;
	int p;
	double q;
	
	public DefiningVeriables() {
		super();
		// TODO Auto-generated constructor stub
	}
	public DefiningVeriables(String s, int n, int k, int z, int p, double q) {
		super();
		this.s = s;
		this.n = n;
		this.k = k;
		this.z = z;
		this.p = p;
		this.q = q;
	}
	public String getS() {
		return s;
	}
	public void setS(String s) {
		this.s = s;
	}
	public int getN() {
		return n;
	}
	public void setN(int n) {
		this.n = n;
	}
	public int getK() {
		return k;
	}
	public int setK(int k) {
		return this.k = k;
	}
	public int getZ() {
		return z;
	}
	public void setZ(int z) {
		this.z = z;
	}
	public int getP() {
		return p;
	}
	public void setP(int p) {
		this.p = p;
	}
	public double getQ() {
		return q;
	}
	public void setQ(double q) {
		this.q = q;
	}

}
